        "description": "偌大的城市\n竟无处可去\n\n汹涌的人潮\n竟无人可诉\n\n街角的霓虹闪烁\n像极了你的心事\n\n忽明忽暗，似有若无\n\n看过不同的风景\n流连过也迷惘着\n\n遇过不堪的事情\n无奈过也为难着\n\n你说\n人生短暂\n为何这般艰难\n\n殊不知\n未知才更神秘\n曲折也是精彩\n\n不是吗\n\n时光旖旎，荼靡未谢\n这一路悲欢离合尝尽\n\n谢谢自己，未曾放弃\n未来里风霜雨雪相迎",
